"use client"

import React, { useEffect } from "react";
import styled from "styled-components";
import { useRouter, useSearchParams } from "next/navigation";
import {logger} from "@/app/services/logger";

const SuccessContainer = styled.div`
  padding: 20px;
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const Receipt = styled.div`
  border: 1px solid #ccc;
  padding: 20px;
  margin-bottom: 20px;
  width: 80%;
  text-align: left;
`;

const BtnPrint = styled.button`
  margin-top: 20px;
  padding: 10px 20px;
  font-size: 18px;
  background-color: #000;
  color: #fff;
  border: none;
  border-radius: 5px;
  cursor: pointer;

  &:hover {
    background-color: #333;
  }
`;

const BtnClose = styled.button`
  margin-top: 20px;
  padding: 10px 20px;
  font-size: 18px;
  background-color: #f00;
  color: #fff;
  border: none;
  border-radius: 5px;
  cursor: pointer;

  &:hover {
    background-color: #c00;
  }
`;

const SuccessPage = () => {
  useEffect(() => {
    const connectToPrinter = async () => {
      try {
        await new Promise((resolve, reject) => BTPrinter.list(resolve, reject));
        await new Promise((resolve, reject) =>
          BTPrinter.connect(resolve, reject, "BlueTooth Printer")
        );
        logger.info("Connected to printer successfully.");
      } catch (error) {
        alert("Failed to connect to the printer.");
        alert(error);
        logger.error("Failed to connect to the printer:", error);
      }
    };

    connectToPrinter();
  }, []);
  const router = useRouter();
  const { amount, currency, title } = useSearchParams();

  const handlePrint = async () => {
    const base64Image =
      "data:image/jpg;base64,";
    await new Promise((resolve, reject) =>
      BTPrinter.printBase64(
        (data) => {
          logger.info("Success");
          logger.info(data);
          resolve(data);
        },
        (err) => {
          logger.error("Error: ", err);
          reject(err);
        },
        base64Image, // Base64 string
        "1" // Alignment
      )
    );
    await new Promise((resolve, reject) =>
      BTPrinter.printTextSizeAlign(
        (data) => {
          logger.info("Success: ", data);
          resolve(data);
        },
        (err) => {
          logger.error("Error: ", err);
          reject(err);
        },
        "Rechnung \n", // string to print
        "10", // size
        "0" // align
      )
    );
    await new Promise((resolve, reject) =>
      BTPrinter.printTextSizeAlign(
        (data) => {
          logger.info("Success: ", data);
          resolve(data);
        },
        (err) => {
         logger.error("Error: ", err);
          reject(err);
        },
        `${title}\n`, // string to print
        "20", // size
        "0" // align
      )
    );
    await new Promise((resolve, reject) =>
      BTPrinter.printText(resolve, reject, `${amount} ${currency}\n `)
    );
    await new Promise((resolve, reject) =>
      BTPrinter.printText(
        resolve,
        reject,
        `${title}\n ${amount} ${currency}\n `
      )
    );
    await new Promise((resolve, reject) =>
      BTPrinter.printTextSizeAlign(
        (data) => {
          logger.info("Success: ", data);
          resolve(data);
        },
        (err) => {
          logger.error("Error: ", err);
          reject(err);
        },
        "\n\n___________________\n\n\n",
        "10",
        "0"
      )
    );
    await new Promise((resolve, reject) =>
      BTPrinter.printText(
        resolve,
        reject,
        "www.hungryheads.app \n info@r-l-gastro.de \n Telefon: 089-123 456 89 \n\n\n\n\n\n\n"
      )
    );
  };

  const handleClose = async () => {
    await new Promise((resolve, reject) =>
      BTPrinter.disconnect(resolve, reject, "BlueTooth Printer")
    );
    router.push("/");
  };

  return (
    <SuccessContainer>
      <h1>Payment Successful</h1>
      <Receipt>
        <p>
          <strong>Item:</strong> {title}
        </p>
        <p>
          <strong>Amount:</strong> {amount} {currency}
        </p>
      </Receipt>
      <BtnPrint onClick={() => handlePrint().catch((e) => alert(e))}>
        Print Receipt
      </BtnPrint>
      <BtnClose onClick={handleClose}>Close</BtnClose>
    </SuccessContainer>
  );
};

export default SuccessPage;
